import {
  CREATE_WORK,
  DELETE_WORK,
  READ_WORK,
  READ_WORK_ITEM,
  UPDATE_WORK,
} from "./workTypes";

export default (work = [], action) => {
  switch (action.type) {
    case CREATE_WORK:
      return work;
    case DELETE_WORK:
      return work;
    case READ_WORK:
      return work;
    case READ_WORK_ITEM:
      return work;
    case UPDATE_WORK:
      return work;
    default:
      return work;
  }
};
